import React from "react";
import { useNavigate } from "react-router-dom";
import "./styles/Sidebar.css";

const Sidebar = () => {
    const navigate = useNavigate();
    return (
        <div id="sidebar__container">
            <div id="now__date">2023.00.00 00:00:00</div>
            <div id="company__info"></div>
            <div id="side__menu"></div>
            <div className="menu__item" id="menu__item__1" onClick={() => navigate("/Main")}></div>
            <div className="menu__item" id="menu__item__2" onClick={() => navigate("/Main")}></div>
            <div className="menu__item" id="menu__item__3" onClick={() => navigate("/Main")}></div>
        </div>
    );
}

export default Sidebar;
